var randUser = function(users) {
	var totalUsers = users.length;
	var randomUser = Math.floor(Math.random()*totalUsers);
	return users[randomUser];
}


db.sync({force: true})
.then(function () {
	var promisesForUsers = initialUsers.map(function(user) {
		return User.create(user);
	});
	return Promise.all(promisesForUsers)
		.then(function(users) {
			var promisesForEmails = randomEmailData.map(function(email) {
				return Email.create(email);
			});
			return Promise.all(promisesForEmails)
			.then(function(emails) {
				var promisesForConnections = [];
				emails.forEach(function(email){
					promisesForConnections.push(email.setSender(randUser(users)));
					promisesForConnections.push(email.addRecipient(randUser(users), {isRead: true}));
					promisesForConnections.push(email.addCopied(randUser(users), {isRead: true}));
					promisesForConnections.push(email.addCopied(randUser(users), {isRead: true}));
					promisesForConnections.push(email.addCopied(randUser(users), {isRead: true}));
				})
				return Promise.all(promisesForConnections);
			})
		})
})
.then(function () {
  console.log('Seeding successful');
}, function (err) {
  console.error('Error while seeding');
  console.error(err.stack);
})
